const Home = (props) => {
  const setUserdata = props.setUserdata;
  const userdata = props.userdata;

  return (
    <div className="homePage">
      {userdata && <h1 class>Welcome to Fitness Tracker! </h1>}
      {userdata && <h2>Logged in as {userdata.username}</h2>}
    </div>
  );
};

export default Home;
